export default (function(a,b,c,d){return {data:{"1pFUgZUQqU":{data:{id:1327,attributes:{imdbId:"tt0120689",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTUxMzQyNjA5MF5BMl5BanBnXkFtZTYwOTU2NTY3._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"8.6\u002F10"},{Source:"Rotten Tomatoes",Value:"78%"},{Source:"Metacritic",Value:"61\u002F100"}],item_lang:{data:{id:1990,attributes:{title:a,plot:"Death Row guards at a penitentiary, in the 1930's, have a moral dilemma with their job when they discover one of their prisoners, a convicted murderer, has a special gift.",slug:"the-green-mile"}}},books:{data:[{id:7201,attributes:{title:a,description:"Repackaged to tie in with Castlerock's major motion picture release of the season, starring Tom Hanks. At Cold Mountain Penitentiary, prison guard Paul Edgecombe has seen the good, the evil, the innocent, and the guilty. But he's never seen anything like new prisoner John Coffey.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=v-IoDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2017-06-27",publisher:"Simon and Schuster",subtitle:"The Complete Serial Novel"}},{id:7202,attributes:{title:a,description:"Die letzte Hinrichtung »The Green Mile« – so nennt sich der Todestrakt des Staatsgefängnisses Cold Mountain. John Coffey wurde zum Tode verurteilt, weil er zwei Mädchen missbraucht und ermordet haben soll. Dem Hünen wohnt aber auch eine übernatürliche Kraft inne ... Kann ein Mörder zugleich ein begnadeter Heiler sein? Und wenn ja, darf oder sollte man ihn dann töten? Verfilmt mit Oscar-Preisträger Tom Hanks. »So betörend und berührend wie gleichzeitig verstörend.« Entertainment Weekly",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=b2l6DZRKW_cC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2011-02-18",publisher:"Heyne Verlag",subtitle:"Roman"}},{id:7203,attributes:{title:a,description:"At Col Mountain Penitentiary, along the lonely stretch of cells known as the Green Mile, killers as depraved as the psychopathic \"Billy the Kid\" Wharton and the possessed Eduard Delacroix await death strapped in \"Old Sparky.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=luDQvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1996-01-01",publisher:"New Amer Library",subtitle:"The Complete Six Part Novel"}},{id:7204,attributes:{title:a,description:"In a chilling novel by the author of Carrie and The Stand, a new prisoner at Cold Mountain Penitentiary presents an unusual dilemma for jaded prison guard Paul Edgecombe. Reprint. Movie tie-in.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ulIoAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1999-11-01",publisher:d,subtitle:d}},{id:7205,attributes:{title:a,description:"Stephen King's international bestselling - and highly acclaimed - novel, also a hugely successful film starring Tom Hanks The Green Mile: those who walk it do not return, because at the end of that walk is the room in which sits Cold Mountain penitentiary's electric chair. In 1932 the newest resident on death row is John Coffey, a giant black man convicted of the brutal murder of two little girls. But nothing is as it seems with John Coffey, and around him unfolds a bizarre and horrifying story. Evil murderer or holy innocent - whichever he is - Coffey has strange powers which may yet offer salvation to others, even if they can do nothing to save him.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MUowvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2005-01-01",publisher:"Orion Media",subtitle:d}}]}}},meta:{}}},prerenderedAt:1680940982758}}("The Green Mile","Stephen King",null,""))